      title:
        "Custom Edible Image Cake Topper Your Photo Logo Cupcakes Cookies Cake Strips Personalized",
      description:
        "HOW TO SEND YOUR CAKE IMAGE / PHOTO / LOGO / FILE TO CUSTOMIZE EDIBLE CAKE TOPPER:\nAfter you place your order, send us a message with your image or logo.\nClick &quot;Contact Seller&quot; and &quot;Attach Image&quot; button to include the file.\n\nIf you need any help, don&#39;t hesitate to contact us!\n\nEdible cake toppers are perfect for any event: Birthday\u00a0Parties, Weddings, Bridal Showers, Baby Showers, Graduations, Business Parties, Sports Events,\n\nOUR FROSTING SHEETS ARE GLUTEN, DAIRY AND GMO FREE! \n* Our frosting sheets are made in the USA and are gluten and dairy free with no known allergens. *\n* Edible Cake Images are FDA approved and can be stored for several months, if kept sealed in a plastic bag.  *\n* Edible Images do NOT require refrigeration and should be stored at room temperature. *\n\n...............................................\n\n\nWHAT IS AN EDIBLE CAKE IMAGE:\nAn edible image is the result of printing an image using edible inks (edible food colors) onto an edible frosting sugar sheet. \nAn Edible Cake Topper can be easily applied to any cake with minimal effort and amazing results. \nCake Top Shop uses frosting sheets of the highest quality to obtain the best results!\n\n...............................................\n\n\n1 - HOW TO PLACE YOUR ORDER for a CUSTOM PHOTO EDIBLE TOPPER: \nPlease use the drop-down menu to select CAKE SIZE and QUANTITY.\n\nEDIBLE CAKE SIZES:\n- Quarter Sheet - 8&quot; x 10&quot;\n- Half Sheet - 10&quot; x 16&quot;\n- Round Sheet - 7.5&quot; Diameter\n- Cupcakes - 2&quot; (sheet with 12 pre-cut circles) \n- Cupcakes - 3&quot; (sheet with 6 pre-cut circles) \n- Cake Strips - 2.5&quot; x 10.5&quot;\n\nYou can add a free CUSTOM MESSAGE to your cake image!\nTo do so, please use the &quot;Add your personalization&quot; box or the NOTE TO SELLER box at checkout to provide the message you want printed on your cake topper.\n(Example: Happy Birthday Ava).\n\n...............................................\n\n\n2 - HOW TO SEND US YOUR IMAGE / PHOTO / LOGO / FILE:\nAfter you place your order, send us a message and include your photo/ logo.\nTo do so, click &quot;Contact Seller&quot; and &quot;Attach Image&quot; link to send us the file you want printed.\n\nIf you need any help, don&#39;t hesitate to contact us!\n\n...............................................\n\n\nHOW TO APPLY:\n\n* Instructions and helpful hints are packaged with your cake topper! *\n\nEdible Photo Instructions\n1. Prepare Your Cake\nYour printed edible photo can be applied to almost any kind of icing such as fondant, sugar paste, royal icing, buttercream or glace icing.\nThe frosting on your cake, cupcakes or cookies can be any color, but remember that your edible photo is made from thin icing, so dark colors may not always be suitable.\n\n2. Prepare Your Edible Photo\nKeep your edible photo in its sealed plastic bag until you are ready to use it. Take it out of the bag before applying it to the cake to allow time for it to dry out slightly. This will make it easier to peel from the backing sheet.\n\n3. Remove Your Edible Photo from the Backing Sheet\nGently roll the backing sheet over the edge of a table or counter (with image facing up) to loosen the image\nand lay the sheet on top of your cake.\n\n...............................................\n\n\nCAKE IMAGE DESIGN AVAILABLE:\nIf you have an idea for your cake topper, but need some help with the design, feel free to contact us! \n\n...............................................\n\nORDER PROCESSING & SHIPPING:\n* Orders ship next business day\n\n* First Class Mail can take up to 8 business days, Priority mail (2/4 days - not guaranteed) and Express mail (1/2 days - guaranteed) can be selected at checkout.\n\n* Please note that USPS First-Class and Priority Mail products are not guaranteed and may temporarily require extra time to be delivered due to limited transportation availability as a result of the Coronavirus (COVID-19) pandemic. Express mail is still guaranteed in 1/2 days. *\n\n\n\n***********************************************************\n\nBy purchasing this item you agree to all shop policies.\n\nNON CUSTOM PRODUCTS:\n\nWe accept returns within 14 days of delivery\nNo exchanges accepted\nPlease contact us, if you have any issues with your order.\n\nReturn Conditions:\nBuyers are responsible for return shipping costs. If the item is not returned in its original condition, the buyer is responsible for any loss in value.\n\nCUSTOM PRODUCTS:\nAll sales are final on custom products. No refunds, exchanges or returns accepted, but please contact us, if you have any issues with your order.\n\nColors may vary slightly depending on your screen settings.",
